import React from 'react'
import Part from './Part'

const Content = ( {parts} ) => {

    return (
        <ul>     
        {parts.map(
            // part => console.log(part.name)
            part => <Part key={part.id} part={part} />
            )
        }
        </ul>
    )
  }

export default Content
